import React from "react";
import img1 from "../images/testimg.jpeg";
import Image from "react-bootstrap/Image";

export const team = () => (
  <div>
    <div>
      <div
        className="titleteam"
        style={{
          fontSize: 25,
          color: "#1949ad",
          textAlign: "center",
          padding: 10,
        }}
      >
        <strong>OUR TEAM</strong>
      </div>
    </div>

      <div className="imagewrap" style={{ padding: 15, backgroundColor:"yellow",width:250 , float:"left"}}>
        <Image
          src={img1}
          roundedCircle
          style={{ width: 175, paddingLeft: 10 }}
        />
      </div>
      <div style={{backgroundColor:"red", float:"left"}}>
      Waseem Ahmed
      </div>


  </div>
);

export default team;
